function onlyEven(array) {
  // your code here
  let filteredArray = array.filter(number => (number % 2 === 0));
  return filteredArray;
}

function onlyOneWord(array) {
  // your code here
  //check type of item
  let filteredArray = array.filter(item => typeof item === 'string' && item.split(' ').length === 1);
  return filteredArray;
}

function positiveRowsOnly(array) {
  // your code here
  let result = [];
  array.forEach(allNumbers => {
    let positiveNumbers = allNumbers.filter(x => x >= 0);
    if (allNumbers.length === positiveNumbers.length) {
      result.push(positiveNumbers);
    }
  });
  return result;
}

function allSameVowels(array) {
  // your code here
  let filteredArray = array.filter(item => {
    //Filter any vowel in the string and save them in the filteredItem
    let filteredItem = item.match(/[aeiou]/ig);
    //Filter only the filteredItem where all the vowels are the same
    return filteredItem.every(x => x === filteredItem[0]);
  });
  return filteredArray;
}

module.exports = {
  onlyEven,
  onlyOneWord,
  positiveRowsOnly,
  allSameVowels
};
